  false,\n\t\"url\": null,\n\t\"notes\": \"Aerial surveys to determine the population
  size, composition, and distribution of moose (Alces alces) along the Canning and
  Kongakut River drainages were conducted on the Arctic National Wildlife Refuge.
  The Canning River drainage was surveyed in mid-September and late October to determine
  seasonal shifts in moose distribution. Numbers of moose observed increased from
  78 in September to 149 in October. Moose had evidently not yet moved to the drainage
  in September. Shallow snow depth and incomplete snow cover are believed to be the
  major factors for differences in moose numbers between the 2 surveys. Number of
  moose along the Claiming River (149) was approximately the same as the 1980 spring
  survey (148). This population is evidently relatively stable. The Kougakut River
  survey detected 153 moose, which is 28% more than the 1980 spring survey. The increased
  population may be due to immigration from surrounding river valleys, which has been
  a factor in previous years. The population may also be increasing on its own.\",\n\t\"owner_org\":
